import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import sampleIcon from '../../assets/images/default.png'
import { fetchApiData, storeApiData } from "../../api/api";

const toggleDetail = (state, index) => {
    let dropdown = document.getElementsByClassName('applier-detail')[index];

    if (state == 'show') dropdown.style.display = 'block';
    if (state == 'hide') dropdown.style.display = 'none';
}

const CompanyApplierItem = ({index, id, title, description, document, status, applicationDate, profile, company, job}) => {
    const [doRefresh, setDoRefresh] = useState(false)

    const showDetail = () => {
        toggleDetail('show', index)
    }

    const hideDetail = () => {
        toggleDetail('hide', index)
    }

    const console = () => {

    }

    // const loadURLToInputField = () => {
    //     let file = new File()
    // }

    return (
        <>
        <button onClick={showApplierDetail}>
            <div className="company_applier__wrapper__card">
                <div className="company_applier__wrapper__card--center">
                    <div className="company_applier__wrapper__card--center__part-1">
                        <h1>{profile.fullname}</h1>
                        <p>{job.title}</p>
                        <Link className={status === "pending" ? "full-time" : "half-time"} to={`/job-details/${status}`}>{status}</Link>
                    </div>
                </div>
            </div>
        </button>
        <div className="applier-detail">
            <button className="applier-detail-hide" type="button" onClick={hideApplierDetail}>
                <i className="fa fa-close fa-fw"></i>
            </button>
            <div className="applier-detail-container">
                <h1>Applier's Message</h1>
                <div className="applier-detail-row">
                    <p>Applier Name: </p>
                    <p>{profile.fullname}</p>
                </div>
                <div className="applier-detail-row">
                    <p>Job Applied: </p>
                    <p>{job.title}</p>
                </div>
                <div className="applier-detail-row">
                    <p>Title: </p>
                    <p>{title}</p>
                </div>
                <div className="applier-detail-row">
                    <p>Description: </p>
                    <p>{description}</p>
                </div>
                <div className="applier-detail-row">
                    <p>Document: </p>
                    {/* <iframe src={document} frameborder="0" style={{ width: '100%', height: '500px' }}></iframe> */}
                    <a href={document} download="applier's CV">View Applier's CV</a>
                </div>
                <br />
                <h1>Details</h1>
                <button className="applier-detail-profile-button">Click to See Applier's Profile Detail</button>
                <button className="applier-detail-job-button">Click to See Job Applied Detail</button>
                <br />
                <div className="applier-detail-container-button">
                    <button type="button" className="btn-reject half-time">Reject</button>
                    <button type="button" className="btn-accept full-time">Accept</button>
                </div>
            </div>
        </div>
        </>
    )
}

export default CompanyApplierItem
